import React from "react";
import "./Card.css";

const Card = () => {
  const currentTime = new Date().toLocaleTimeString();

  return (
    <div className="card">
      <div className="card-header">Magic Moment</div>
      <img
        src="https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=800&q=60"
        alt="Starlit Night"
        className="card-image"
      />
      <div className="card-body">
        <h2>Starlit Night</h2>
        <p>A peaceful night under a sky full of stars.</p>
        <div className="button-group">
          <button className="btn">← Left</button>
          <button className="btn">Right →</button>
        </div>
        <div className="footer">
          <span>{currentTime}</span>
          <button className="btn share-btn">Share</button>
        </div>
      </div>
    </div>
  );
};

export default Card;
